import React from 'react';
import { useNavigate } from 'react-router-dom';
import { FaTable, FaProjectDiagram, FaSitemap } from 'react-icons/fa';
import { ChevronDown, Eye, CheckCircle, Info, AlertTriangle, XCircle } from 'lucide-react';
import { useStateContext } from '../context/StateContext';

const getMessageIcon = (type) => {
  switch (type) {
    case 'success':
      return <CheckCircle className="text-green-500" size={16} />;
    case 'info':
      return <Info className="text-blue-500" size={16} />;
    case 'warning':
      return <AlertTriangle className="text-yellow-500" size={16} />;
    case 'error':
      return <XCircle className="text-red-500" size={16} />;
    default:
      return null;
  }
};

const formatTime = (dateString) => {
  const date = new Date(dateString);
  return date.toLocaleTimeString([], {
    hour: '2-digit',
    minute: '2-digit',
    second: '2-digit',
  });
};

const MessagePanel = () => {
  const {
    messages,
    normalizedTables,
    fetchSelectedTableData,
    addMessage,
    erDiagramGenerated,
    fdGenerated,
  } = useStateContext();

  const navigate = useNavigate();

  const handleTableClick = async (tableName) => {
    try {
      addMessage({ text: `Loading table ${tableName}...`, type: 'info', timestamp: new Date() });
      await fetchSelectedTableData(tableName);
      navigate('/table-view');
    } catch (error) {
      console.error('Error fetching table data:', error);
      addMessage({
        text: `Error loading table ${tableName}: ${error.response?.data?.error || error.message}`,
        type: 'error',
        timestamp: new Date(),
      });
    }
  };

  const handleERDiagramClick = () => navigate('/er-diagram');
  const handleFDPageClick = () => navigate('/fd-view');

  return (
    <div className="h-full flex flex-col">
      {/* Header */}
      <div className="bg-gray-50 border-b border-gray-200 px-4 py-3">
        <h2 className="text-lg font-semibold text-gray-800">Messages</h2>
        <p className="text-sm text-gray-600">Activity log and navigation</p>
      </div>

      {/* Content */}
      <div className="flex-1 overflow-y-auto p-4">
        {/* Normalized Tables Dropdown */}
        {normalizedTables.length > 0 && (
          <div className="mb-4 p-3 bg-blue-50 border border-blue-200 rounded-lg">
            <div className="flex items-center justify-between mb-2">
              <span className="text-sm font-medium text-blue-800">Normalized Tables (3NF)</span>
              <ChevronDown size={16} className="text-blue-600" />
            </div>

            <div className="space-y-2">
              {normalizedTables.map((table) => (
                <button
                  key={table}
                  onClick={() => handleTableClick(table)}
                  className="w-full text-left px-3 py-2 text-sm bg-white border border-blue-200 rounded hover:bg-blue-50 flex items-center space-x-2"
                >
                  <FaTable className="text-blue-600" />
                  <span>{table}</span>
                </button>
              ))}
            </div>

            {erDiagramGenerated && (
              <button
                onClick={handleERDiagramClick}
                className="w-full mt-2 px-3 py-2 text-sm bg-blue-600 text-white rounded hover:bg-blue-700 transition-colors flex items-center justify-center space-x-2"
              >
                <Eye size={14} />
                <span>Show ER Diagram</span>
              </button>
            )}

            {fdGenerated && (
              <button
                onClick={handleFDPageClick}
                className="w-full mt-2 px-3 py-2 text-sm bg-purple-600 text-white rounded hover:bg-purple-700 transition-colors flex items-center justify-center space-x-2"
              >
                <FaSitemap size={14} />
                <span>Show Functional Dependencies</span>
              </button>
            )}
          </div>
        )}

        {/* Messages List */}
        <div className="space-y-3">
          {messages.map((msg, index) => (
            <div
              key={index}
              className="flex items-start space-x-3 p-3 bg-white rounded-lg border border-gray-200"
            >
              <div className="flex-shrink-0 mt-0.5">{getMessageIcon(msg.type)}</div>
              <div className="flex-1 min-w-0">
                <p className="text-sm text-gray-800">{msg.text}</p>
                {msg.timestamp && (
                  <p className="text-xs text-gray-500 mt-1">{formatTime(msg.timestamp)}</p>
                )}
              </div>
            </div>
          ))}
        </div>

        {messages.length === 0 && (
          <div className="text-center text-gray-500 mt-8">
            <div className="text-4xl mb-2">📋</div>
            <p className="text-sm">No messages yet</p>
            <p className="text-xs text-gray-400">Activity updates will appear here</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default MessagePanel;
